import React from 'react'
import { StyleSheet, Text, TouchableOpacity, View, FlatList } from 'react-native';

export default TodoList = ({ list }) => {
    return (
        <View style={[styles.listContainer, { backgroundColor: list.color }]}>

            <Text>
                {list.name}
            </Text>
        </View>
    )
}
